source.buildSpec:
{
  "version": "0.2",
  "phases": {
    "build": {
      "commands": [
        "npm install -g aws-cdk",
        "ls -la $CODEBUILD_SRC_DIR",
        "cd $CODEBUILD_SRC_DIR/Eugene",
        "python -m pip install -r requirements.txt",
        "cdk synth"
      ]
    }
  },
  "artifacts": {
    "base-directory": "Eugene/cdk.out",
    "files": "**/*"
  }
}
